import React from "react";
import styled from "styled-components";
import BorderEffect from "./BorderEffect";

const Wrapper = styled.div`
  position: relative;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const BorderEffectBox = () => {
  return (
    <Wrapper>
      <BorderEffect />
    </Wrapper>
  );
};

export default BorderEffectBox;
